import React, { useState } from "react";

const BALLS_PER_OVER = 6;
const MAX_WICKETS = 10;

const CricketPrediction = () => {
    const initialOvers = Array.from({ length: 20 }, () => ({
        balls: [],
        locked: false,
    }));

    const [innings, setInnings] = useState(1);
    const [overs, setOvers] = useState(initialOvers);
    const [wickets, setWickets] = useState(0);
    const [runs, setRuns] = useState(0);

    const runOptions = [0, 1, 2, 3, 4, 5, 6, "Wide", "No Ball", "Wicket"];

    const handlePrediction = (overIndex, run) => {
        if (overs[overIndex].locked || wickets >= MAX_WICKETS) return;

        setOvers((prevOvers) => {
            const newOvers = [...prevOvers];
            const currentOver = { ...newOvers[overIndex] };
            const balls = [...currentOver.balls];

            // Count legal deliveries
            const legalBalls = balls.filter((ball) => ball !== "Wide" && ball !== "No Ball").length;

            if (legalBalls >= BALLS_PER_OVER && run !== "Wide" && run !== "No Ball") return newOvers;

            balls.push(run);
            currentOver.balls = balls;
            newOvers[overIndex] = currentOver;

            if (typeof run === "number") setRuns((prevRuns) => prevRuns + run);
            else if (run === "Wide" || run === "No Ball") setRuns((prevRuns) => prevRuns + 1);
            if (run === "Wicket") setWickets((prevWickets) => Math.min(MAX_WICKETS, prevWickets + 1));

            return newOvers;
        });
    };

    const freezeOver = (overIndex) => {
        setOvers((prevOvers) => {
            const newOvers = [...prevOvers];
            newOvers[overIndex].locked = true;
            return newOvers;
        });
    };

    return (
        <div style={styles.container}>
            <h1>Cricket Prediction</h1>
            <h2>Runs: {runs} | Wickets: {wickets}/{MAX_WICKETS}</h2>

            <div style={styles.grid}>
                {overs.map((over, index) => {
                    const legalBalls = over.balls.filter((ball) => ball !== "Wide" && ball !== "No Ball").length;
                    const overLocked = over.locked || legalBalls >= BALLS_PER_OVER;

                    return (
                        <div key={index} style={styles.overBox}>
                            <h4>Over {index + 1}</h4>
                            <p style={styles.predictions}>{over.balls.length ? over.balls.join(" | ") : "No predictions yet"}</p>
                            
                            <select
                                onChange={(e) => handlePrediction(index, e.target.value === "Wicket" || e.target.value === "Wide" || e.target.value === "No Ball" ? e.target.value : Number(e.target.value))}
                                disabled={overLocked || wickets >= MAX_WICKETS}
                                style={styles.dropdown}
                            >
                                <option value="">Select Run</option>
                                {runOptions.map((run, i) => (
                                    <option key={i} value={run}>
                                        {run}
                                    </option>
                                ))}
                            </select>

                            <button onClick={() => freezeOver(index)} disabled={overLocked} style={styles.freezeButton}>
                                Freeze Over
                            </button>
                        </div>
                    );
                })}
            </div>

            <button onClick={() => setInnings((prev) => (prev === 1 ? 2 : 1))} style={styles.switchButton}>
                {innings === 1 ? "Switch to 2nd Innings" : "Switch to 1st Innings"}
            </button>
        </div>
    );
};

const styles = {
    container: {
        padding: "10px",
        textAlign: "center",
        fontFamily: "Arial, sans-serif",
    },
    grid: {
        display: "grid",
        gridTemplateColumns: "repeat(auto-fit, minmax(150px, 1fr))",
        gap: "10px",
        justifyContent: "center",
        padding: "10px",
    },
    overBox: {
        border: "1px solid #ccc",
        padding: "8px",
        borderRadius: "5px",
        textAlign: "center",
        backgroundColor: "#f9f9f9",
    },
    predictions: {
        fontSize: "12px",
        marginBottom: "5px",
        color: "#333",
    },
    dropdown: {
        padding: "5px",
        fontSize: "12px",
        width: "100%",
        marginBottom: "5px",
    },
    freezeButton: {
        padding: "5px",
        fontSize: "12px",
        backgroundColor: "#007bff",
        color: "white",
        border: "none",
        borderRadius: "3px",
        cursor: "pointer",
        width: "100%",
    },
    switchButton: {
        marginTop: "10px",
        padding: "10px",
        backgroundColor: "#28a745",
        color: "white",
        border: "none",
        borderRadius: "5px",
        fontSize: "14px",
        cursor: "pointer",
    },
};

export default CricketPrediction;
